import React from 'react';
import { Link } from 'react-router-dom';

const UsersPage = () => {
  // You can fetch the user's role from the token here
  const userRole = getUserRoleFromToken(); // Implement the logic to extract the user's role

  return (
    <div>
      <h2>Welcome to the User Management Dashboard</h2>
      {userRole === 'admin' ? (
        <Link to="/get-users">See All Users</Link>
      ) : (
        <p>Unauthorized access</p>
      )}
    </div>
  );
};

export default UsersPage;
